import React, { useState } from "react";
import "./App.css";
import { Sun, Moon, PlaneTakeoff, Globe, Luggage, Map } from "lucide-react";

function App() {
  const [tripData, setTripData] = useState({
    name: "",
    from_city: "",
    destination_country: "",
    start_date: "",
    duration_days: "",
    budget_inr: "",
    interests: "",
  });

  const [plan, setPlan] = useState(null);
  const [loading, setLoading] = useState(false);
  const [darkMode, setDarkMode] = useState(false);

  const handleChange = (e) => {
    setTripData({ ...tripData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setPlan(null);

    try {
      const response = await fetch("http://localhost:8000/plan_trip", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          ...tripData,
          interests: tripData.interests.split(",").map((i) => i.trim()),
        }),
      });

      const data = await response.json();
      setPlan(data.plan);
    } catch (error) {
      console.error("Error fetching plan:", error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className={`App ${darkMode ? "dark" : ""}`}>
      {/* 🌍 Navbar */}
      <nav className="navbar">
        <div className="logo">
          <Globe size={24} />
          WanderAI
        </div>
        <div className="nav-actions">
          <button onClick={() => setDarkMode(!darkMode)} className="mode-toggle">
            {darkMode ? <Sun size={20} /> : <Moon size={20} />}
          </button>
        </div>
      </nav>

      {/* 🌄 Hero */}
      <div className="hero">
        <h1 className="title">Plan Your Dream Trip with AI ✈️</h1>
        <p className="subtitle">Smarter Travel Starts Here. Crafted for Modern Explorers.</p>
        <div className="hero-icons">
          <PlaneTakeoff />
          <Luggage />
          <Map />
        </div>
      </div>

      {/* 📝 Form */}
      <form onSubmit={handleSubmit} className="form">
        {Object.keys(tripData).map((key) => (
          <input
            key={key}
            type={key.includes("date") ? "date" : "text"}
            name={key}
            value={tripData[key]}
            placeholder={key.replaceAll("_", " ")}
            onChange={handleChange}
            required
          />
        ))}
        <button type="submit" disabled={loading}>
          {loading ? "Planning..." : "🚀 Plan My Trip"}
        </button>
      </form>

      {/* ⏳ Loading */}
      {loading && <p className="loading">⏳ Planning your dream trip...</p>}

      {/* 📋 Result */}
      {plan && (
        <div className="plan-output">
          <h2 className="section-title">🌍 Your Premium AI Trip Plan</h2>

          <div className="section">
            <h3>🛫 Flights</h3>
            <div className="card">{plan.flights}</div>
          </div>

          <div className="section">
            <h3>🏨 Hotels</h3>
            <div className="card">{plan.hotels}</div>
          </div>

          <div className="section">
            <h3>🗓️ Itinerary</h3>
            <div className="card">{plan.itinerary}</div>
          </div>

          <div className="section">
            <h3>🛂 Visa Info</h3>
            <div className="card">{plan.visa}</div>
          </div>
        </div>
      )}

      {/* 🌐 Footer */}
      <footer className="footer">
        <p>🌎 Made with love for travelers by WanderAI</p>
      </footer>
    </div>
  );
}

export default App;
